Diagnosis:

Micronecta gracilis

is distinguished by the elongate body form (
Figs. 46c–e
), expanded palar claw (
Figs. 47d
, 
48a
), and distinct male parameres (
Figs. 48b–g
). Females are distinguished by general facies and combination of the prothoracic lobe (
Fig. 47a
) and metaxyphus (
Fig. 47b
).

Hemelytral microsculpturing consisting of dense, fine transverse meshes distributed over entire surface. Short setae uniformly distributed over entire hemelytral surface. In macropterous forms, metathoracic wings well-developed reaching to apex of hemelytra. Wings reduced in the single examined brachypterous specimen, reaching only to abdominal segment VI. Lateral spines on abdominal segments IV–VIII: IV: one stout, short spine, two thin, long setae; V: two stout, short setae, one long, stout seta, one long, thin seta; VI: two stout, short setae, one long, stout seta; VII: two short, stout spines, one long, stout spine one long, thin seta; VIII: seven stout, short spines, two long, stout spines, two long, thin setae. Metaxyphus of both sexes broad, triangular, with apex broadly rounded (
Fig. 47b
).

Lateral lobes of abdominal tergum IV comparatively broad, of even length, and rounded apically. Right lobe with nine long setae, left lobe with eight long evenly spaced, apically placed setae. Prestrigilar flap of tergal segment V as in 
Figure 47e
. Strigil well-developed, elongated, narrow with few combs. Median lobe of sternite VII broad basally (
Fig. 47f
), long, with numerous short setae restricted sub-basally, apex triangular, narrowly rounded. Free lobe of tergite VIII (

Fig. 
47g

) broad, nearly quadrate in outline, outer angle narrowly rounded and inner angle comparatively short. Setae of varying lengths placed over entire apical portion and numbering about 29. Pars stridens processus cleaner ridges of tergite VIII not examined. Male left paramere (
Figs. 48b–f
) long, narrow and parallel-sided, apex curved inward and terminating into a sharp, recurved hook, scales present in interior portion of apical hook. Base broad, upper portion reaching nearly to middle of paramere shaft, lower portion of base broadly rounded (
Figs. 48b–d
). Right paramere (
Figs. 48b–d, f
) long, convexly curved, and nearly parallel-sided, tip gradually tapering to bluntly rounded point (
Fig. 48f
). Base comparatively short, widened, with lower portion rounded. Pars stridens processus consisting of about 19 plectral ribs confined to lower portion (

Fig. 
48g

). Aedeagus broad, as in 
Figures 48b–d
.
